import React from 'react';

const UiTestPage: React.FC = () => {
  return (
    <div className="min-h-screen bg-gray-50 flex flex-col items-center justify-center py-16">
      <h1 className="text-4xl font-bold text-gray-900 mb-8">UI Test Page</h1>
      <div className="w-full max-w-2xl bg-white rounded-2xl shadow-lg p-8 border border-gray-200 flex flex-col items-center">
        {/* Place your UI experiments here */}
        <div className="text-lg text-gray-600">This is a dummy page for testing UI code. Add your components or code below.</div>
        <div className="w-full mt-8 min-h-[200px] flex items-center justify-center bg-gray-100 rounded-xl border border-dashed border-gray-300">
          {/* UI test area */}
          <span className="text-gray-400">UI test area</span>
        </div>
      </div>
    </div>
  );
};

export default UiTestPage;
